window.bookSummaryJSON = "<p>Major Jake Thomas is on a roll. With the help of the Artificial Life: Intelligent Computing Environments, or ALICE, systems, he has successfully faced off with the hostile NeHaw three times. With continued support from his inner circle of female recruits, all handpicked by the ALICEs to further their own agenda, he continues to try to help Earth return to glory. </p> <p>As Jake works to assemble a space fleet from captured and constructed vessels to address the expanding NeHaw aggression, the terrestrial challenges at home continue to pile up. With troubles in California, Maine, and Washington State to plague Jake and his team, the threat of a two-front war looms ahead. </p>"; 
